INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawy','','Polityka dostaw','conditions, delivery, delay, shipment, pack','<h2>Polityka dostaw</h2>\n<h3>1. Czas realizacji zamówienia</h3>\n<p>Zamówienia złożone i opłacone do godziny <strong>12:00</strong> realizowane są tego samego dnia roboczego.<br />Zamówienia złożone po tej godzinie lub w dni wolne od pracy realizowane są w <strong>następnym dniu roboczym</strong>.<br />Czas realizacji obejmuje przygotowanie, zapakowanie i przekazanie przesyłki do wybranego przewoźnika.</p>\n<h3>2. Sposoby dostawy</h3>\n<p>Oferujemy trzy formy dostawy:</p>\n<ul>\n<li><strong>Pacztex</strong> – dostawa kurierska pod wskazany adres, zazwyczaj w ciągu<strong> 2–3 dni roboczych </strong>od momentu wysyłki.</li>\n<li><strong>MikPost</strong> – dostawa do punktu odbioru lub automatu paczkowego, zwykle w ciągu<strong> 3–4 dni roboczych</strong>.</li>\n<li><strong>Odbiór w sklepie</strong> – możliwość bezpłatnego odbioru zamówienia w naszym sklepie stacjonarnym. Zamówienie jest gotowe do odbioru zazwyczaj w ciągu <strong>24 godzin</strong> od złożenia.</li>\n</ul>\n<h3>3. Koszty dostawy</h3>\n<p>Koszt dostawy zależy od wybranej metody wysyłki i jest podawany w koszyku przed potwierdzeniem zamówienia.<br />Przy zamówieniach powyżej<strong> </strong><strong>2000 zł</strong> dostawa jest <strong>bezpłatna</strong>.</p>\n<h3>4. Opóźnienia i kontakt</h3>\n<p>W przypadku opóźnień w dostawie lub uszkodzenia paczki prosimy o niezwłoczny kontakt z naszym działem obsługi klienta</p>','dostawy'),(2,1,1,'Informacje prawne','','Informacje prawne','notice, legal, credits','<h2><strong>Podziękowania</strong></h2>\n<p>Ta strona internetowa została stworzona przy użyciu oprogramowania open-source <strong>PrestaShop™</strong>.</p>','informacje-prawne'),(3,1,1,'Terms and conditions of use','','Our terms and conditions of use','conditions, terms, use, sell','<h2>Your terms and conditions of use</h2><h3>Rule 1</h3><p>Here is the rule 1 content</p>\r\n<h3>Rule 2</h3><p>Here is the rule 2 content</p>\r\n<h3>Rule 3</h3><p>Here is the rule 3 content</p>','terms-and-conditions-of-use'),(4,1,1,'O nas','','Learn more about us','about us, informations','<h2>O nas</h2>\n<p>Witamy w Flyhouse – miejscu, w którym pasja spotyka się z profesjonalizmem. Jesteśmy zespołem zaangażowanych specjalistów, którzy od lat działają w branży wędkarstwa. Naszą siedzibą jest Gdańsk, ale działamy­­—z powodzeniem­­—na rynku internetowym, dostarczając klientom produkty najwyższej jakości.</p>\n<h3>Nasza misja</h3>\n<p>Naszym celem jest zapewnienie wszystkim miłośnikom wędkarstwa muchowego dostępu do sprawdzonego sprzętu, renomowanych marek i fachowego doradztwa. Wierzymy, że dobry sprzęt i właściwa wiedza pozwalają czerpać pełnię radości z każdej chwili spędzonej na łonie natury.</p>','o-nas'),(5,1,1,'Secure payment','','Our secure payment mean','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\r\n<h3>Our secure payment</h3><p>With SSL</p>\r\n<h3>Using Visa/Mastercard/Paypal</h3><p>About this services</p>','secure-payment');
/*!40000 ALTER TABLE `ps_cms_lang` ENABLE KEYS */;
UNLOCK TABLES;

