INSERT INTO `ps_product_lang` VALUES (20,1,1,'Wędka muchowa Orvis Helios 4Finesse czwartej generacji to narzędzie do połowu na muchę w wodach słodkich. Wędka radzi sobie z każdym typem linki muchowej na wszystkich dystansach. Wszechstronne zastosowanie w różnych warunkach od małych strumieni po wielkie jeziora. Matowy blank oliwkowy z oliwkowymi owijkami. Przelotki na podwójnej stpce firmy RECOIL® Guides. Aluminiowa tuba w kolorze biało-perłowym. Wszystkie wędki z serii Helios 4F są objęte 25-letnią gwarancją. Wyprodukowano w USA.','','wedka-muchowa-orvis-helios-4f','','','','Wędka muchowa Orvis Helios 4F','','','',''),(21,1,1,'<p>Wędka muchowa Orvis Helios 4Distance czwartej generacji to narzędzie do połowu na muchę w wodach słonych i słodkich. Wędka radzi sobie z każdym typem linki muchowej na wszystkich dystansach. Wszechstronne zastosowanie w różnych warunkach. Czarny matowy blank z czarnymi omotkami. Przelotki na podwójnej stpce firmy RECOIL® Guides. Aluminiowa tuba w kolorze biało-perłowym. Wszystkie wędki z serii Helios 4D są objęte 25-letnią gwarancją. Wyprodukowano w USA.</p>','','wedka-muchowa-orvis-helios-4d','','','','Wędka muchowa Orvis Helios 4D','','','',''),(22,1,1,'Słynny rewolwerowiec Wyatt Earp zwykł mawiać „ Szybkość jest dobra ale celność jest najważniejsza”. To co wędkarz odkrywa wraz z doświadczeniem to właśnie to. W wędkarstwie muchowym celność to bardzo często klucz do sukcesu. Nie ważne czy jest to spływ muchy w strefie żerowania ryby, czy poprowadzenie jej w zasięgu wzroku przepływającego drapieżnika czy też zaprezentowanie jej we właściwej warstwie wody , różnica kilku centymetrów może być różnica pomiędzy porażką a sukcesem. Wszystkie nowoczesne wędki są mocne ale celność jest nowym wyznacznikiem jakości. Wykonanie dwudziestoczterometrowego rzutu łowiąc w morzu jest szukaniem na ślepo. Wykonanie dwunastometrowego rzutu wprost pod nos żerującej ryby, to jest wędkarstwo muchowe. Wspomnij swoje sukcesy i porażki wędkarskie, a odpowiedź stanie się jasna. Celność rodzi sukces. Helios 3  przesunął nasze myślenie o projektowaniu wędek, ze skupiania się na profilu blanku do kolejnej granicy jaką jest celność i projektowanie każdej wędki z myślą o konkretnym przeznaczeniu. Orvis Helios 3F i 3D oferują bezkompromisowe właściwości. 3F to marzenie każdego łowcy na suchą muchę, celność połączona z finezją. Orvis Helios 3D to kompilacja celności z energią pozwalająca rzucić sporą muchą na dużą odległość i bardzo precyzyjnie. Różnica miedzy 3D a 3F  jest w sztywności,  ale właściwości celnego rzucania pozostają te same. Aby grać w tę grę na najwyższym poziomie, nie ma kompromisów i dla każdego wędkarza Orvis Helios 3 jest narzędziem zaprojektowanym aby cieszyć się najpiękniejszymi chwilami i osiągnąć szczyty precyzji od małych strumieni po morskie łowy Big Game. Wybierz swoją przygodę i najlepszą broń.','','wedka-muchowa-orvis-helios-3d-blue','','','','Wędka muchowa Orvis Helios 3D Blue','','','',''),(23,1,1,'Słynny rewolwerowiec Wyatt Earp zwykł mawiać „ Szybkość jest dobra ale celność jest najważniejsza”. To co wędkarz odkrywa wraz z doświadczeniem to właśnie to. W wędkarstwie muchowym celność to bardzo często klucz do sukcesu. Nie ważne czy jest to spływ muchy w strefie żerowania ryby, czy poprowadzenie jej w zasięgu wzroku przepływającego drapieżnika czy też zaprezentowanie jej we właściwej warstwie wody , różnica kilku centymetrów może być różnica pomiędzy porażką a sukcesem. Wszystkie nowoczesne wędki są mocne ale celność jest nowym wyznacznikiem jakości. Wykonanie dwudziestoczterometrowego rzutu łowiąc w morzu jest szukaniem na ślepo. Wykonanie dwunastometrowego rzutu wprost pod nos żerującej ryby, to jest wędkarstwo muchowe. Wspomnij swoje sukcesy i porażki wędkarskie, a odpowiedź stanie się jasna. Celność rodzi sukces. Helios 3  przesunął nasze myślenie o projektowaniu wędek, ze skupiania się na profilu blanku do kolejnej granicy jaką jest celność i projektowanie każdej wędki z myślą o konkretnym przeznaczeniu. Orvis Helios 3F i 3D oferują bezkompromisowe właściwości. 3F to marzenie każdego łowcy na suchą muchę, celność połączona z finezją. Orvis Helios 3D to kompilacja celności z energią pozwalająca rzucić sporą muchą na dużą odległość i bardzo precyzyjnie. Różnica miedzy 3D a 3F  jest w sztywności,  ale właściwości celnego rzucania pozostają te same. Aby grać w tę grę na najwyższym poziomie, nie ma kompromisów i dla każdego wędkarza Orvis Helios 3 jest narzędziem zaprojektowanym aby cieszyć się najpiękniejszymi chwilami i osiągnąć szczyty precyzji od małych strumieni po morskie łowy Big Game. Wybierz swoją przygodę i najlepszą broń.','','wedka-muchowa-orvis-helios-3f','','','','Wędka muchowa Orvis Helios 3F','','','',''),(24,1,1,'Dzięki wędziskom Recon zyskujesz wysoką wydajność, lekkość, zdolność ładowania na niewielkich dystansach i moc zapewniającą większy zasięg, a także — dzięki technikom konstrukcyjnym H3 — zwiększoną dokładność rzutów. A wszystko to w przystępnej cenie. Recon to wędka zaprojektowana dla wędkarzy, którzy przemierzają brzegu rzek, jezior, mórz czy oceanów i spędzają noce pochyleni nad mapami, planując przygody na następny dzień. Wędki wykonane w najwyższej technologii Orvis. Wędka sprzedawana jest bez kołowrotka widocznego na zdjęciu.','','wedka-muchowa-orvis-recon','','','','Wędka muchowa Orvis Recon','','','',''),(25,1,1,'Powrót klasyki! Zaktualizowaliśmy te kultowe wędki małych strumieni, ale zachowaliśmy delikatność, która sprawiła, że oryginały stały się ulubionymi. Pół wieku temu opracowaliśmy pierwszą serię wędzisk Orvis Graphite Fly Rods jedne z pierwszych wędzisk grafitowych dostępnych dla wędkarzy. Podzbiór tych innowacyjnych wędzisk miał mniej niż 8 stóp długości i wahał się od 1 do 5 wt. Te klasyki były cenione za ich miękkie wyczucie i możliwość łowienia w małych strumieniach. Nazwy poszczególnych wędzisk są już legendarne... One-Weight, The Ultrafine, The Tippet, The Seven/Eleven, The Far &amp; Fine. Nasza nowo zaprojektowana seria wędzisk Superfine® Graphite Fly Rods opiera się na tych klasycznych modelach linek i długości Orvis. Zaprojektowane przy użyciu technik konstrukcyjnych Helios™, dobrze odzyskują ciężar i pięknie śledzą, co poprawia wydajność i dokładność. Ta seria Superfine oferuje wędkarzom nowe, nowoczesne wersje, które skupiają się na prezentacji w małych strumieniach i ochronie przyponu. Zachowaliśmy również legendarne nazwy, grawerując każdą z nich na nasadce dolnika. Każda czteroczęściowa wędka ma matowoszary blank z płytkim stożkiem, czarny anodowany aluminiowy uchwyt kołowrotka z blokadą, twarde chromowane przelotki typu snake, chromowane przelotki typu stripping i korkowy uchwyt w stylu cygara. Zawiera pokrytą materiałem tubę wędki i pokrowiec z nadrukiem wędki. Wyprodukowano w USA. Nowo zaprojektowana seria wędek do małych strumieni zainspirowana naszymi oryginalnymi kultowymi modelami Superfine. Te same nazwy, długości i ciężary żyłki, aby uhonorować kultowe oryginały. Techniki konstrukcyjne Helios poprawiają wydajność i dokładność. Niższy moduł grafitu zapewnia powolne do umiarkowanych akcji w całej serii. Czteroczęściowy matowoszary blank z zabytkową białą etykietą i odręcznym pismem. Czarny anodowany aluminiowy uchwyt kołowrotka z blokadą z wkładką korkową. Twarde chromowane przelotki typu snake. Chromowane przelotki typu stripping z wkładkami z węglika krzemu. Korkowy uchwyt w stylu cygara. Grawerowana laserowo nazw na nasadce dolnika. Pokryta materiałem tuba wędki i pokrowiec wędki.','','wedka-muchowa-orvis-superfine-graphite','','','','Wędka muchowa Orvis Superfine Graphite','','','',''),(26,1,1,'Nasza seria wędek muchowych Superfine Glass, świeżo przeprojektowana, została wykonana z włókna szklanego S-2, aby zapewnić płynne, powolne rzucanie z mocą potrzebną do wykonania zadania. Czarny uchwyt kołowrotka z anodowanego aluminium typu III z wkładką drewnianą (klasy wędki 2-5) lub aluminiową rurką (klasy wędki 6 i 8). Twarda chromowana przelotka i dwustopkowa przelotka z paskiem. Matowy blank oliwkowy z szybkim identyfikatorem wędki. W zestawie nylonowa tuba wędki i materiałowy worek do przechowywania. Gwarancja 25 lat firmy Orvis. Wyprodukowano w USA.','','wedka-muchowa-orvis-superfine-glass','','','','Wędka muchowa Orvis Superfine Glass','','','',''),(27,1,1,'Nowe wędki Orvis Clearwater to nie jest kosmetyczny lifting tylko, całkowicie od początku do końca, nowo zaprojektowana seria. Projekt powstał w Vermont USA w pracowniach designerskich Orvisa. Wszystko w tych wędkach zostało zmienione oprócz ceny. To wciąż są najlepsze wędki na rynku, jakie możesz kupić za tą cenę, ale o jeszcze lepszych parametrach i w lepszym wykonaniu. Każda wędka została indywidualnie zaprojektowana do konkretnych zadań. Do każdej stworzono unikalny profil, akcję oraz uchwyt, które sprawdzą się podczas wybranego sposobu łowienia na muchę. Zakres modeli obejmuje wędki od takich do łowienia na małych strumieniach, poprzez wędki do połowów w dużych zbiornikach, aż po morskie mega wędki. Seria jednoręcznych wędek Clearwater zawiera 19 modeli. Między innymi 10’ wędka w klasie 3 do łowienia metodą żyłkową, 9’4’’ w klasie 11 specjalnie zaprojektowana do połowu szczupaków czy 9’ czwórka stworzona do połowu na suchą muchę. Główne cechy:','','wedka-muchowa-orvis-clearwater','','','','Wędka muchowa Orvis Clearwater','','','',''),(28,1,1,'Zabierz do samochodu, wędkę Clearwater Travel Rod w drodze do pracy, lub włóż ją do bagażu na dalekie wyprawy wędkarskie, te wędki muchowe są przeznaczone do wędrówek. Te 6-częściowe wędki muchowe mają wystarczająco mocny blank, aby używać dużych much na potężne ryby (wyższe klasy), a zarazem delikatne aby finezyjnie podać suchą muszkę. Seria Clearwater Travel Rod jest pełna udogodnień, które zwiększają wydajność wędkowania i wygodę w niewiarygodnej cenie.','','wedka-muchowa-orvis-clearwater-travel','','','','Wędka muchowa Orvis Clearwater Travel','','','',''),(29,1,1,'Odkryj niezrównaną wydajność i przystępną cenę dzięki wędce muchowej Encounter. Zamiast określenia „poziom podstawowy” wolimy opisywać nasze nowe wędki Encounter jako „niesamowitość w przystępnej cenie”. Seria wędek Encounter, stworzona dla zagorzałych wędkarzy, ale wyceniona z myślą o oszczędności, łączy najnowocześniejszą konstrukcję wędki z płynną, wyrazistą wydajnością. Ta solidna wędka Orvis Encounter ma całą moc i wydajność, jakiej ktokolwiek mógłby oczekiwać, w cenie, która sprawi, że będziesz się zastanawiać, gdzie jest haczyk? Wędka zapasowa lub pierwszy wędka do połowu dużych ryb, to najlepsza, jaką kiedykolwiek kupisz w tej cenie. Stworzona dla zagorzałych wędkarzy, ale wyceniona z myślą o oszczędności.','','wedka-muchowa-orvis-encounter','','','','Wędka muchowa Orvis Encounter','','','',''),(30,1,1,'Odkryj niezrównaną wydajność i przystępną cenę dzięki zestawowi wędki muchowej Encounter®. Zamiast określenia „poziom podstawowy” wolimy opisywać nasze nowe zestawy wędek Encounter jako „niesamowitość w przystępnej cenie”. Seria wędek Encounter, stworzona dla zagorzałych wędkarzy, ale wyceniona z myślą o oszczędności, łączy najnowocześniejszą konstrukcję wędki z płynną, wyrazistą wydajnością — w zestawie z dużym kołowrotkiem Encounter (rozmiar IV), pływającą żyłką 8-wt. z przodu, podkładem, przyponem i pokrowcem na wędkę/kołowrotek. Ten solidny zestaw Encounter o wadze 9 stóp i wadze 8 ma całą moc i wydajność, jakiej ktokolwiek mógłby oczekiwać, w cenie, która sprawi, że będziesz się zastanawiać, gdzie jest haczyk? Zestaw zapasowy lub pierwszy zestaw wędki do połowu dużych ryb, to najlepszy, jaki kiedykolwiek kupisz w tej cenie. Stworzony dla zagorzałych wędkarzy, ale wyceniony z myślą o oszczędności.','','wedka-muchowa-orvis-encounter-zestaw','','','','Wędka muchowa Orvis Encounter zestaw','','','',''),(31,1,1,'Oferujemy w przystępnej cenie gotowy do łowienia zestaw w najpopularniejszych klasach i długościach. Zestaw zawiera wędkę , kołowrotek, linkę i podkład. Opakowanie Encounter dostarcza wyrób najlepszej jakości jaką można znaleźć na rynku w podobnej cenie. Zestaw Encounter może być również z powodzeniem zakupiony przez bardziej doświadczonych wędkarzy jako zestaw zapasowy na wyprawę  życia.','','wedka-muchowa-z-kolowrotkiem-orvis-encounter','','','','Wędka muchowa z kołowrotkiem Orvis Encounter','','','',''),(32,1,1,'Zapożyczyliśmy techniki inżynieryjne z naszej kolekcji Helios 3, aby stworzyć tę linię wędzisk dopasowaną do różnych stylów rzutowych. Ta wszechstronna linia zawiera pozwala dorzucić duże muchy do odległego brzegu. Wędki Mission nadają się zarówno na dużą jak i małą wodę. Seria Mission świetnie poradzi sobie z linkami Scandi lub głowicami Skagit. Odpowiednio zaprojektowany blank tłumi drgania, aby włożyć więcej energii z każdym rzutem. Jest to prawdziwy system autokorekty, który poprawia prezentację i ratuje nieudane rzuty. Te wyrozumiałe wędziska muchowe oferują imponującą kontrolę przynęty i doskonały zasięg, dzięki czemu możesz precyzyjnie podać przynętę nawet do odległych brzegów dużych rzek łososiowych lub zrzucać mniejszymi muchami. Wędki Mission są lekkie, ale każda z nich jest potężną mocą. Dwuręczna kolekcja Mission obejmuje kompaktowe wędki muchowe na małe rzeki oraz wszechstronne modele, które świetnie radzą sobie zarówno na małych jak i dużych wodach, a także morskie bestie zdolne do wykonywania ciężkich zadań. Objęte 25-letnią gwarancją.','','wedka-muchowa-orvis-mission-dwureczna','','','','Wędka muchowa Orvis Mission dwuręczna','','','',''),(33,1,1,'Nowe wędki Orvis Clearwater to nie jest kosmetyczny lifting tylko, całkowicie od początku do końca, nowo zaprojektowana seria. Projekt powstał w Vermont USA w pracowniach designerskich Orvisa. Wszystko w tych wędkach zostało zmienione oprócz ceny. To wciąż są najlepsze wędki na rynku, jakie możesz kupić za tą cenę, ale o lepszych parametrach i w lepszym wykonaniu. Każda wędka została indywidualnie zaprojektowana do konkretnych zadań. Do każdej stworzono unikalny profil, akcję oraz uchwyt, które sprawdzą się podczas wybranego sposobu łowienia na muchę. Zakres modeli dwuręcznych obejmuje wędki od Micro Spey w klasie 3, która świetnie się sprawdzi podczas łowienia na niewielkie streamery czy mokrą muchę, do 15\' wędki w klasie 10 na największe rzeki inajmocniejsze ryby. Seria dwuręcznych wędek Clearwater zawiera 8 modeli. Między innymi dwie wędki typu switch, jedna wędka w klasie 3 typu Micro Spey oraz 5 modeli Spey na każdą okazję.  Główne cechy:','','wedka-muchowa-orvis-clearwater-switch-spey-dwureczna','','','','Wędka muchowa Orvis Clearwater Switch & Spey dwuręczna','','','',''),(34,1,1,'Od specjalisty streamerów Kelly\'ego Galloupa: Podążając za planem przekazanym nam przez innowatora Kelly\'ego Galloupa, opracowaliśmy następną generację wydajnych wędzisk streamerowych. Precyzja przy dużych, ciężkich muchach. Te nowe wędziska są zaprojektowane tak, aby uderzać w kubek kawy z odległości 50 stóp muchą większą od kubka. Każdy cal tych wędzisk został zaprojektowany aby szybko się ładować i dostarczać muchę z minimalną liczbą falskastów. Dzięki szybkiej szczytówce i mocnemu dolnikowi stożki mają wyjątkową zbieżność, aby dostarczać ciężkie muchy. Zaskakująca wszechstronność. Dzięki niestandardowemu kształtowi uchwytu Kelly\'ego, mocnej dolnej części i szybko ładującej się górnej części, ta wędka jest zbudowana od góry do dołu dla dużych much i precyzji. Jeśli obecne warunki wymagają mniejszych much, nadal będzie Cię zaskakiwać swoją wszechstronnością! Rozmiar idealny dla małych i średnich streamerów Pomiędzy, które dobrze radzą sobie z większymi muchami, a jednocześnie są zabawne i skuteczne w przypadku mniejszych. Do dużych, ciężkich, przypominających zonkerów, nasiąkniętych wodą, obciążonych conheadami much bestii. Takkkkk...','','wedka-muchowa-echo-streamer-x','','','','Wędka muchowa Echo Streamer X','','','',''),(35,1,1,'Flagowa seria wędek do połowu w słonej wodzie ECHO Jeśli zapytasz dookoła, idealna wędka do połowu w słonej wodzie to taka, która pomoże Ci trafić w cel przy minimalnej liczbie falskastów. Podczas połowu ryb z płytkich łowisk wszystko dzieje się szybko i zwykle w „strefie śmierci” 40–60 stóp. Wszystko w wędce ECHO PRIME zostało zoptymalizowane, aby pomóc Ci odnieść sukces w tej strefie. Łatwe ładowanie i długości do szybkich strzałów Łatwo ładująca się szczytówka i skrócona długość 8\'10” sprawiają, że można szybciej wykonywać rzuty z mniejszym wysiłkiem. Umiarkowane poziomy mocy poprawiają czucie podczas rzutu, ale nie zawodzą przy długich strzałach. Od lekkich przelotek na czubku wędki, przez wielostrefowy kształt uchwytu, po bezpunktową walkę na końcu, każdy cal wędki został zaprojektowany, aby pomóc Ci umieścić muchę w celu i pomóc Ci, gdy zatniesz rybę. Dostępne modele od 8wt do 12wt. Te dyskretne wędki to najbardziej wszechstronne wędki ECHO do łowienia w słonej wodzie,jakie kiedykolwiek zaprojektowaliśmy. Rozmiar do szerokiej gamy połowów przybrzeżnych w słonej wodzie. Doskonały wszechstronny model do połowu przybrzeżnego i na płyciznach. Lekki tarpon, permit, duży redfish, offshore i wiele innych to wszystko w zasięgu ręki Prime 10wt. Tarpon, permit, duży redfish, offshore i wiele innych to wszystko w zasięgu ręki Prime 11wt. Duża armata. Na duże ryby słonowodne, jakie tylko sobie wymarzysz.','','wedka-muchowa-echo-prime-4','','','','Wędka muchowa Echo Prime 4','','','',''),(36,1,1,'','','wedka-muchowa-echo-epr','','','','Wędka muchowa ECHO EPR','','','',''),(37,1,1,'Dla wędkarzy na poziomie elitarnym ECHO współpracowało z doświadczonym guru Euro Nymph Pete\'em Ericksonem, mistrzem świata w wędkarstwie muchowym z 2018 r. Normem Maktimą i ekspertem Mariuszem Wróblewskim (profesorem inżynierii Uniwersytetu Berkley), aby stworzyć wędkę, która jest dostosowana do najwyższych poziomów tego sportu. 20% lżejsza niż seria Shadow II Dzięki zastosowaniu najbardziej zaawansowanego grafitu o wysokim module sprężystości, jaki jest dostępny, ECHO udało się stworzyć najlżejszą wędkę, jaką kiedykolwiek wyprod