epszej kontroli linki zarówno w sytuacjach połowu muchą suchą, jak i lekkim nimfowaniem. ECHO CARBON XL 9\'0\" / 274 cm #5. waga ok. 3,5 uncji/100 g - Najbardziej wszechstronna wędka ECHO na pstrągi słodkowodne, kropka. Suche, nimfy, małe strumienie i jeziora. Twoja wędka na pstrągi, która jest „szwajcarskim scyzorykiem”. ECHO CARBON XL 9\'0\" / 274 cm #6. waga ok. 3,7 uncji/105 g - Na wypadek, gdy potrzebujesz trochę więcej mocy do większych much i większych ryb. Świetnie nadaje się do łowienia na pokolce, duże chruściki, stymulatory, średnie streamery i zestawy nimfowe.','','wedka-muchowa-echo-carbon-xl','','','','Wędka muchowa Echo Carbon XL','','','',''),(50,1,1,'Wędka zapewniająca maksymalną prędkość linki Zbudowana na bazie oryginalnej serii Boost, Boost Fresh jest przeznaczona dla wędkarzy o agresywnym rytmie rzutu, aby osiągnąć maksymalną prędkość linki. Wędki mają nieco mniejszą wagę i udoskonaloną akcję, aby pomóc Ci poczuć obciążenie wędki. Wyrazista, szybka akcja Boost jest produkowany z mieszanki włókien grafitowych o średnim module sprężystości, co zapewnia optymalne połączenie wytrzymałości i wydajności. Wybór materiałów pozwala na maksymalną wydajność w przystępnej cenie. Najwyższa równowaga mocy i precyzji Boost to idealna wędka dla agresywnych wędkarzy, którzy nie mogą żyć bez tego nowoczesnego, szybkiego odczucia wędki. ECHO BOOST FRESH 8\'0\" / 243 cm #4. waga ok. 71 g. Dla oddanych wędkarzy łowiących na suchą muchę na małych rzekach. ECHO BOOST FRESH 9\'0\" / 274 cm #4. waga ok. 80 g Świetny rozmiar do wszystkiego, od lekkiego nimfowania po umiarkowane przynęty suche i małe streamery. Dodatkowa długość dla lepszej kontroli żyłki na wodzie. ECHO BOOST FRESH 9\'0\" / 274 cm #5. waga ok. 87 g Rozmiar wędki, którego nie trzeba przedstawiać: wszechstronny rozmiar wędki „do wszystkiego” na wody słodkie. ECHO BOOST FRESH 9\'0\" / 274 cm #6. waga ok. 90 Wybór na duże suche przynęty/hoppery i średniej wielkości streamery.','','wedka-muchowa-echo-boost-freshwater','','','','Wędka muchowa Echo Boost Freshwater','','','',''),(51,1,1,'Musky i szczupaki jedzą duże ofiary. …….. a muchy używane do ich łowienia pasują do wylęgu! Niewiele wędek jest zbudowanych od podstaw, aby załadować i dostarczyć połowę kurczaka. Z pomocą Midwest Musky &amp; Pile Junkies Współpracowaliśmy z niektórymi z najbardziej zafascynowanych wędkarzy łowiących musky i szczupaki na Środkowym Zachodzie, aby opracować serię wędek, które sprawdzą się w każdej sytuacji: blisko wody, wysokie relingi, ósemki, pełne tonące, średnia końcówka, 1000 rzutów, głupie duże muchy… Rozumiesz, o co chodzi. Wędki 11wt z uchwytami dolnymi Musky są dostępne w dwóch długościach, obie w 11wt. 8’8″ do łowienia blisko wody i 9’4″ do „wyższych” łodzi. Wybierz ten, który najlepiej pasuje do Twojego stylu... ECHO MUSKY 8\'8\" / 268 cm #11. waga ok. 134 g. Dobry do brodzenia po „płaskowyżu” Morza Bałtyckiego w pogoni za słonymi szczupakami. Muskies mają zaprojektowane okno gramatury/gramu 400 gr -500 gr lub 26 g - 32 g. ECHO MUSKY 9\'4\" / 286 cm #11 waga ok. 134 g. - 9\'4″ jest dla tych, którzy wolą nieco dłuższą wędkę lub łowią z łodzi, gdzie dodatkowa długość jest do sięgnięcia w dół i wykonania tańca przy łodzi, aby zjeść z bliska. Muskies mają zaprojektowane okno gramatury/gramu 400 gr -500 gr lub 26 g - 32 g.','','wedka-muchowa-echo-musky','','','','Wędka muchowa Echo Musky','','','',''),(52,1,1,'Echo Lift Kit Zestaw:','','zestaw-muchowy-echo-lift-kit','','','','Zestaw muchowy Echo Lift Kit','','','',''),(53,1,1,'w tym ION Reel i AirFlo Line. waga ok. 88 g w tym ION Reel i AirFlo Line. waga ok. 96 g w tym ION Reel i AirFlo Line. waga ok. 105 g w tym ION Reel i AirFlo Line. waga ok. 116 g Echo Traverse Kit Zestaw:','','zestaw-muchowy-echo-traverse-kit','','','','Zestaw muchowy Echo Traverse Kit','','','',''),(54,1,1,'Gecko to najlepsze narzędzie wędkarskie dla dzieci. Dzięki skromnej, wyrozumiałej akcji i przyjaznej dzieciom/hipisowskiej estetyce, Gecko jest gotowy do akc