HO FULL SPEY 13\'0\" / 396 cm #8 Spey Rod. waga ok. 205 g','','wedka-muchowa-echo-full-spey-dwureczna','','','','Wędka muchowa Echo Full Spey dwuręczna','','','',''),(57,1,1,'Nowoczesna akcja spey w kompaktowej długości. W związku z tym, że trendy w nowoczesnych linkach spey stają się coraz bardziej kompaktowe, nadszedł czas, aby zaprojektować wędki z myślą o tych nowych linkach. Wykorzystując nasze wieloletnie doświadczenie w projektowaniu wędek spey oraz wiedzę mistrza rzutów spey Mariusza Wróblewskiego, wyprodukowaliśmy nasze najbardziej zaawansowane wędki spey, jakie kiedykolwiek wyprodukowaliśmy. Akcja i długość nowoczesnych kompaktowych linek spey. Linki spey ewoluowały od czasu, gdy stały się popularne, jednak wędki pozostały w dużej mierze takie same. Zaczęliśmy więc od zera, aby znaleźć idealną elastyczność i długość, aby najskuteczniej łowić najpopularniejsze obecnie typy kompaktowych linek dwuręcznych. Najlżejsza, najbardziej zaawansowana seria dwuręczna ECHO do tej pory. Jako część większej rodziny nowych wędek spey (Full Spey, Compact Spey, Trout Spey), te nowe wędki są dostosowane do sposobu, w jaki dzisiejsi wędkarze łowią na swoje dwuręczne wędki. Compact Spey ma standardową długość 12′ w 6wt, 7wt i 8wt, idealną do nowoczesnych kompaktowych linek spey. Konstrukcja czteroczęściowa Blank: lekki, o wysokim module sprężystości Akcja: średnio-szybka Tuba: pokrowiec i tuba pokryta materiałem Przelotki: przelotki SIC stripping i przelotki typu snake z twardego chromu Uchwyt kołowrotka: anodowane aluminium ECHO COMPACT SPEY 12\'0\" / 365 cm #6 Spey Rod. waga ok. 165 g ECHO COMPACT SPEY 12\'0\" / 365 cm #7 Spey Rod. waga ok. 170 g ECHO COMPACT SPEY 12\'0\" / 365 cm #8 Spey Rod. waga ok. 178 g','','wedka-muchowa-echo-compact-spey-dwureczna','','','','Wędka muchowa Echo Compact Spey dwuręczna','','','',''),(58,1,1,'Wędka, która otwiera zupełnie nowy świat dla wędkarzy łowiących pstrągi. Nowa wędka Trout Spey jest przeznaczona na okres, gdy owady nie wylęgają się, a Ty chcesz objąć jak największą powierzchnię wody prezentacją pod powierzchnią. Skromna moc i akcja dla maksymalnej wszechstronności. Wędka Trout Spey jest lekka i dostosowana do znacznie więcej niż tylko dwuręcznego wymachu. z głowicami Skagit i Scandi: odrzucaj emergera ze szczytówki, wykonaj mending kilometr linki za pomocą zestawu z nimfą wskaźnikową, nimfą na żyłce, łowij na muchę suchą i wszystko inne, czego możesz potrzebować na ciągle zmieniających się łowiskach pstrągów. Nasza najbardziej zaawansowana seria dwuręczna do tej pory ściśle powiązana z innymi flagowymi wędkami dwuręcznymi, Full Spey i Compact Spey, wędka Trout Spey jest częścią najbardziej zaawansowanej serii wędek Spey, jakie kiedykolwiek wyprodukowała firma ECHO. Konstrukcja czteroczęściowa Grafit: lekki, o wysokim module Akcja: średnio-szybka Tuba: kwadratowy pokrowiec na wędkę pokryty tkaniną. Przelotki: wytrzymałe chromowane przelotki typu snake. Uchwyt kołowrotka: anodowany uchwyt kołowrotka z czarnego aluminium. ECHO TROUT SPEY 11\'0\" / 335 cm #2, waga ok. 142 g ECHO TROUT SPEY 11\'0\" / 335 cm #3, waga ok. 150 g ECHO TROUT SPEY 11\'0\" / 335 cm #4, waga ok. 165 g','','wedka-muchowa-echo-trout-spey-dwureczna','','','','Wędka muchowa Echo Trout Spey dwuręczna','','','',''),(59,1,1,'Szybka akcja dwuręcznej wędki Tima. Zbudowana z solidnym dolnikiem do nagłych, mocnych zastosowań z dołu. Rzucaj głowicami Skagit, używając pływających linek do tonących końcówek. Konstrukcja czteroczęściowa Blank: Błyszcząca zieleń Akcja: Med Fast + Duża tuba: Pokryty materiałem pokrowiec na wędkę. Przelotki: Czarne paski i przelotki snake. Uchwyty: Posiada trzy style uchwytów z kompozytowymi wkładkami i punktami nacisku Uchwyt kołowrotka: Czarny anodowany uchwyt kołowrotka ECHO TR2 11\'0\" / 335 cm #3 Spey Rod, waga ok. 158 g ECHO TR2 11\'3\" / 344 cm #4 Spey Rod, waga ok. 167g ECHO TR2 12\'6\" / 384 cm #6 Spey Rod, waga ok. 230g ECHO TR2 13\'0\" / 396 cm #7 Spey Rod, waga ok. 252g ECHO TR2 13\'6\" / 414 