dwuręczna','','','',''),(64,1,1,'Połączenie między rzucaniem jedną ręką i dwiema rękami. PRAWDZIWA „wędzisko typu switch”. Wędka, która może być skutecznie używana zarówno do dodawania podwójnego pociągnięcia do rzutu spey jedną ręką, aby wystrzelić głowicę skagit w ciasnych miejscach, jak i do rzutu nad głową. Ekstremalnie lekkie wędziska z mocą głębokiego ładowania. Dzięki zastosowaniu grafitu o wysokim module udało nam się uzyskać niezwykle lekką wędzisko, nie tracąc jednocześnie zdolności do głębokiego ładowania do dolnych sekcji podczas wykonywania rzutów spey. Niezrównana wszechstronność. Niezależnie od tego, czy rzucasz spey krótkim Skagitem z tonącą końcówką, wykonujesz bombery na spławiku, czy wykonujesz skuteczne naprawy na duże odległości z ulubionym zestawem nimfowym, wędzisko OHS jest dostrojone. Konstrukcja czteroczęściowa Blank: Gloss szmaragdowo zielony Akcja: Med Fast+ Tuba: pokrowiec na wędkę i skarpeta pokryte materiałem Przelotki: przelotki SIC Stripping i przelotki Snake Hard Chrome Uchwyty: Posiada zdejmowany uchwyt dolnika Uchwyt kołowrotka: Anodowane aluminium ECHO OHS 10\'4\" / 317 cm #6 One Hand Spey, waga ok. 130 g. ECHO OHS 10\'4\" / 317 cm #7 One Hand Spey, waga ok. 136 g ECHO OHS 10\'4\" / 317 cm #8 One Hand Spey, waga ok. 142 g','','wedka-muchowa-echo-one-hand-spey','','','','Wędka muchowa Echo One Hand Spey','','','',''),(65,1,1,'Wędki zawodnicze zaprojektowane przez Mistrzów Świata i Europu - Kadrę Narodową. Wysokomodułowy japoński blank Carboflex 430 został pokryty matową powłoką lakieru. Nie powoduje to odbicia światła, które płoszy ryby. Idealny rozstaw i wielkość przelotek TITANIUM TM sprawia, ze akcja jest równomierna i niezwykle szybka. Płynne, harmonijne ugięcie sprawia, ze holowanie ryby jest pewne i bezpieczne bez ryzyka jej utraty. W wędzisku zastosowano rękojeść z portugalskiego korka AAAA zakończonego trwałą mieszanką korka z gumą. Uchwyt do kołowrotka jest z wytrzymałego aluminium wykonanego w technologii CNC. Podstawą uchwytu jest mocna, ultralekka tuleja z włókna węglowego. W konsekwencji właściwego i przemyślanego doboru wszystkich elementów tej konstrukcji mamy do czynienia z perfekcyjną wędką, która zadowoli najbardziej wytrawnych \"graczy\". W zestawie znajduje się dzielona cordurowa tuba i miękki pokrowiec służący do transportu w tubach zbiorczych. Wędka jest objęta 25-letnią gwarancją serwisową.','','wedka-muchowa-traper-gst','','','','Wędka muchowa Traper GST','','','',''),(66,1,1,'Zaprojektowane i stworzone od podstaw przez wybitnego znawcę wędek dwuręcznych, Piotra Talmę – Master Instruktora, Silence Spey DH, występują w dwóch wersjach : 13\'0”#7, która sprawdzi się na mniejszych rzekach lub podczas niżówki, 14\'0”#9 na duże rzeki. Wędziska zostały skonstruowane tak, aby z łatwością obsługiwać zarówno głowice Skagit, jak i Scandi. Konstrukcja japońskiego blanku Carboflex 460 zwiększa moc i doskonale tłumi drgania, co zdecydowanie zmniejsza wysiłek podczas wykonywania długich rzutów i podnosi jakość prezentacji. Sześcioskładowa konstrukcja pozwoli Ci podróżować na swoje wymarzone łowiska łososi, troci czy stealheadów bez dodatkowych opłat lotniczych. Wykończone z dbałością o szczegóły. Najwyższej klasy portugalski korek, przelotki Pacific Bay, mocny, aluminiowy uchwyt kołowrotka, wykonany w technologii CNC. W komplecie tuba kordurowa i pokrowiec z miękkiej siatki. Wędzisko jest objęte 25-letnią gwarancją serwisową.','','wedka-muchowa-traper-silence-dh-spey','','','','Wędka muchowa Traper  SILENCE DH Spey','','','',''),(67,1,1,'Po ogromnym sukcesie wędek Silence SW przyszedł czas, aby podnieść poprzeczkę. Przygotowaliśmy coś specjalnego dla wszystkich tych, którzy chcą zmierzyć się z mieszkańcami mórz i oceanów. Od Kostaryki, przez Florydę po Malediwy. Od płochliwych Bonefishy, przez potężne Tarpony po siejące postrach na flatsach GT. Projektując serię Silence Ocean — mieliśmy jeden cel. Stworzyć wędkę, która wyznaczy zupełnie nowy standard w tej półce cenowej. Wędkę, której możecie zaufać. Sercem nowej serii są japońskie nieszlifowane blanki Carboflex 460. Uzbroiliśmy je w lekkie tytanowe przelotki, portugalski korek klasy AAAAA wzmocniony w newralgicznych miejscach wstawkami z korkogumy oraz wykonany w technologii CNC zaprojektowany przez nas uchwyt kołowrotka. W komplecie ochronna aluminiowa tuba oraz pokrowiec z miękkiej siatki. Wędzisko jest objęte 25-letnią gwarancją serwisową','','wedka-muchowa-traper-silence-ocean','','','','Wędka muchowa Traper Silence Ocean','','','',''),(68,1,1,'Konstrukcja wędziska Warrior Spey jest oparta na sprawdzonym blanku 40T. Gwarantuje to, że wędka sprosta wszystkim wyzwaniom. Dwuręczne wędziska tej długości muszą przyjąć i wytrzymać znacznie większe obciążenia od wędek jednoręcznych. Rękojeść wykonana jest z korka AAA, który dla wzmocnienia wykończony został, korkogumą. Solidny, odwrócony uchwyt do kołowrotka posiada docisk w postaci dwóch nakrętek. Amerykańskie przelotki Pacyfic Bay stanowią uzbrojenie wędki. Wędka składa się z sześciu elementów, zapewnia to wygodny transport i umożliwia zabranie wędki w podróż lotniczą, bez dodatkowych opłat. W komplecie tuba z cordury. Wędka posiada pięcioletnią gwarancję serwisową','','wedka-muchowa-traper-warrior-dh-spey','','','','Wędka muchowa Traper Warrior DH Spey','','','',''),(69,1,1,'Wychodząc naprzeciw muszkarzom, którzy mają najwyższe wymagania firma Traper wykonała perfekcyjne i niezawodne wędki SILENCE. Wyprodukowano je z użyciem najnowocześniejszych obecnie technologii. Japońskie blanki węglowe CARBOFLEX 460, uzbrojone w lekkie przelotki TITANIUM, portugalski korek AAAAA oraz nowoczesny ultralekki, a jednocześnie wytrzymały uchwyt kołowrotka. Doskonale wyważone, o równomiernym, harmonijnym ugięciu i szybkiej akcji robią ogromne wrażenie. W dość szerokiej serii można znaleźć wędki od delikatnych dwójek aż po streamerowe siódemki. Wszystkie wyposażone w solidne tuby i oddychające pokrowce. Wędki serii SILENCE są objęte 25 letnią gwarancją dla pierw