, MA. Prosimy o uwzględnienie do 2 tygodni na zbudowanie Twojej wędki przez naszych rzemieślników. Niektóre modele mogą być dostępne wcześniej. Cechy: Gładka, szybka akcja. Nowy uchwyt Special Wells klasy Flor we wszystkich modelach. Matowy metalowy uchwyt kołowrotka z wytłoczonym logo marki T&amp;T. Drewniany insert z drewna sękatego. Czarne chromowane przelotki Snake Brand Universal Snake z czarną tytanową ramką i ceramiczną wkładką z cyrkonii. Czarny zaczep haka. Blank w półpołysku w ciemnym kolorze „T&amp;T Blue”','','wedka-muchowa-thomas-thomas-avantt-ii','','','','Wędka muchowa Thomas & Thomas Avantt II','','','',''),(79,1,1,'Nowy Exocett™ 88 został stworzony, aby poradzić sobie z szeroką gamą sytuacji wędkarskich z precyzją i łatwością. Dzięki łatwemu ładowaniu i progresywnemu działaniu został zaprojektowany tak, aby płynnie dostosowywać się niezależnie od tego, czy podnosisz ciężkie tonące linki, czy używasz pływających linek. Przy długości 8\'8\" i ostrym stożku, Exocett™ 88 oferuje ultraszybkie odzyskiwanie, umożliwiając bezwysiłkowe dalekie rzuty. Zaprojektowany tak, aby zminimalizować zmęczenie, jest idealny do całodniowego wędkowania. Zbudowany z opatentowanego wielomodułowego węgla i warstw S-Glass, 88 ma znacznie większą wytrzymałość niż poprzednie kompozyty, co zapewnia mu lepszą wytrzymałość i zmniejsza ciężar. Ta konstrukcja zapewnia doskonały tracking, precyzję i dokładność, a także ekstremalną moc, gdy jest najbardziej potrzebna. Seria 88 ma również etykiety z klasą linki AFTMA i sugerowaną gramaturą, co upraszcza wybór linki muchowej. Uwaga: Wszystkie wędki T&amp;T są ręcznie robione w Greenfield, MA. Prosimy o uwzględnienie do 2 tygodni na zbudowanie wędki przez naszych rzemieślników. Niektóre modele mogą być dostępne wcześniej. Główne cechy: 4-częściowy 8\'8\" wielomodułowy blank w charakterystycznym wykończeniu „T&amp;T Blue” Semi-Gloss Tytanowe przelotki z ramką z ceramicznymi wkładkami Tytan Recoil przelotki typu snake. Flor-grade 7\" full wells grip. Matowy metaliczny uchwyt kołowrotka z anodowanego na słoną wodę aluminium.','','wedka-muchowa-thomas-thomas-exocett-88','','','','Wędka muchowa Thomas & Thomas Exocett 88','','','',''),(80,1,1,'Najlepsza wędka prezentacyjna. Zapytaj grupę doświadczonych wędkarzy, aby wymienili najlepszą wędkę do suchej muchy wszech czasów, a T&amp;T Paradigm z pewnością zostanie wymieniona więcej niż raz. Ponad dwadzieścia lat później podążaliśmy tą samą inspiracją, która uczyniła z oryginału legendę, aby stworzyć nową Paradigm na XXI wiek. Chociaż postęp technologiczny przesunął granice wagi wędki, prędkości żyłki i odległości rzutu, istota podchodu do podnoszącego się pstrąga i prezentacji muchy pozostaje niezmienna. Mając to na uwadze, postanowiliśmy uchwycić wyjątkowe wrażenia, które sprawiły, że oryginalne wędki muchowe Paradigm były tak magicznym instrumentem. Dobra wędka to wędka, którą można pokochać. Naprawdę coś osiągnąłeś, gdy stworzyłeś wędkę, po którą ludzie chcą sięgnąć przed wszystkimi innymi”. - Tom Dorsey Cechy: Lekkie przelotki typu snake REC Single Foot ze stopu tytanu Tytanowa rama, przelotka Stripping Matowe wykończenie z tytanu, wytłaczane na rolce elementy Przekładki z klonu wzorzystego pochodzące z USA Piękne nowe, półmatowe, niebieskie wykończenie powierzchni Ultralekkie wędki o płynnej, średnio elastycznej akcji, zapewniające wyjątkowe prezentacje.','','wedka-muchowa-thomas-thomas-paradigm','','','','Wędka muchowa Thomas & Thomas Paradigm','','','',''),(81,1,1,'Konstrukcja blanku Contact II wykorzystuje pięć różnych rodzajów najwyższej jakości włókien węglowych i szklanych, połączonych ze sobą za pomocą naszego opatentowanego systemu żywicy lotniczej. Wyrównanie tych włókien pod strategicznymi kątami podczas toczenia blanków Contact II poprawia dokładność, czułość i wytrzymałość. Komponenty zostały starannie dobrane w celu maksymalizacji wydajności i komfortu. Cechy: Zoptymalizowane odstępy między przelotkami z obniżonymi przelotkami, aby zmniejszyć zwis żyłki między dłonią a pierwszą przelotką. Zwiększona moc kręgosłupa, aby poprawić zacięcie i pomóc w lądowaniu większych ryb. Bardzo gęste uchwyty z korka klasy premium Flor zwiększają wyczucie i transmisję brania. Czarne przelotki RECoil typu snake single foot. Czarny uchwyt haka i kontrola nawijania. Czarna przelotka typu „Low Rider” utrzymuje żyłkę bliżej blanku, aby poprawić transmisję uderzenia i dokładność Nowy niskoprofilowy zaokrąglony fighting butt do walki dla równowagi i komfortu Brązowe i oliwkowe owijki na stopkach przelotek. Uchwyt kołowrotka z blokadą w dół standard w modelach 2wt do 4wt. Uchwyt kołowrotka z blokadą w górę dostępny w wędkach 2wt-4wt za dodatkową opłatą 30 USD. Uchwyt kołowrotka z blokadą w całości wykonany z metalu i uchwyt z pełną komorą standard w modelu 1086.','','wedka-muchowa-thomas-thomas-contact-ii-technical-nymphing-rods','','','','Wędka muchowa Thomas & Thomas CONTACT II TECHNICAL NYMPHING RODS','','','',''),(82,1,1,'Thomas &amp; Thomas posiada serię wędek muchowych z włókna szklanego Lotic. Łącząc najnowsze włókna szklane z bardzo progresywnym profilem elastyczności, lekka wędka Lotic zapewnia ostre, średnie działanie z głębokim ładowaniem charakterystycznym dla włókna szklanego. Rezultatem jest wysokowydajna wędka szklana, która generuje zaskakującą prędkość i energię linki, zachowując jednocześnie jedwabiście gładką pracę, idealną do prezentacji suchej muchy. Cechy: Progresywny trzyczęściowy blank z włókna szklanego. Uchwyt Western. Jasno frezowany aluminiowy uchwyt kołowrotka z blokadą do góry z korkowym przekładką. Przelotki ECOating Snake. W komplecie zawiera aluminiową tubę na wędkę z obrabianym maszynowo aluminiowym kołnierzem i nasadką. Niebieski lakier proszkowy z cynowym logo Thomas &amp; Thomas.','','wedka-muchowa-thomas-thomas-lotic','','','','Wędka muchowa Thomas & Thomas Lotic','','','',''),(83,1,1,'Seria Zone wyznacza nowe standardy zarówno pod względem wydajności, jak i ceny, oferując najnowsze osiągnięcia badawczo-rozwojowe firmy Thomas &amp; Thomas większej liczbie wędkarzy muchowych niż kiedykolwiek wcześniej. Wędki Zone, wykorzystujące zaawansowaną żywicę StratoTherm opracowaną dla cenionych serii Avantt i Exocett, są zwijane i budowane ręcznie, obok tych flagowych modeli, w naszym zakładzie w Massachusetts w USA. Cechy: 2wt-4wt akcja średnia/szybka, 5wt-10wt akcja szybka. Naturalny wygląd włókna węglowego. Czarny anodowany uchwyt kołowrotka z wysokiej jakości aluminium. Nowe modele 1022 i 1023 mają uchwyty kołowrotka z blokadą dolną. Korkowe uchwyty wzmocnione kompozytem na wszystkich wędkach. Modele 2wt-5wt mają uchwyty western. Modele 6wt-10wt i 1004 mają uchwyt full-wells z dolną częścią do walki. Przelotki z tytanowej ramy z wkładkami cyrkonowymi. Nici T&amp;T Blue ze srebrnymi akcentami. Wędki słodkowodne (2wt-7wt) mają chromowane przelotki jednostopowe i zaczep na haczyk Wędki słonowodne (8wt-10wt) mają przelotki Snake Brand E-Coating Universal Snake Cała seria posiada aluminiową tubę na wędkę z logo Thomas &amp; Thomas Zone.','','wedka-muchowa-thomas-thomas-zone','','','','Wędka muchowa Thomas & Thomas Zone','','','',''),(84,1,1,'Seria DNA Spey kontynuuje ewolucję wysoko cenionej serii dwuręcznych wędzisk T&amp;T. Są one przeznaczone dla wędkarzy poszukujących wędzisk, które z łatwością poradzą sobie ze wszystkim — Skagit, Scandi, Spey i overhead. DNA Classic to idealny „uniwersalny” i najlepszy wybór dla doświadczonych wędkarzy łowiących na głowice o średniej długości i dłuższe. Modele z oznaczeniem XF są przeznaczone głównie do łowienia głowicami w stylu Scandi i mają ostre, wyraziste wyczucie, idealne do rzucania ciasnymi pętlami z rzutami touch-and-go. Nasze wędziska XD mają głębszy profil elastyczności przeznaczony dla wędkarzy, którzy stosują techniki rzucania „podtrzymywanego kotwiczenia” z głowicami Skagit i dużymi, ciężkimi muchami. Ponieważ każdy model jest indywidualnie zaprojektowany do realizacji odrębnego celu, seria DNA Spey ma odpowiednią wędkę, która sprosta wymaganiom każdej sytuacji wędkarskiej z użyciem dwóch rąk. Cechy: Wielomodułowy blank grafitowy z klasycznym niebieskim wykończeniem T&amp;T o niskim współczynniku tarcia. Uchwyt Spey. Uchwyt kołowrotka z aluminium z blokadą w dół w kolorze szarym cynowym. Przelotki Fuji Stripping i Universal Snake Brand z zielonymi owijkami i czerwoną krawędzią. Zawiera aluminiową tubę na wędkę z obrabianym maszynowo aluminiowym kołnierzem i zatyczką. Niebieski lakier proszkowy z cynowym logo Thomas &amp; Thomas. Uwaga: Wszystkie wędki T&amp;T są ręcznie robione w Greenfield, MA. Prosimy o uwzględnienie 6-8 tygodni na zbudowanie wędki przez naszych rzemieślników.','','wedka-muchowa-thomas-thomas-dna-spey-dwureczna','','','','Wędka muchowa Thomas & Thomas DNA Spey dwuręczna','','','',''),(85,1,1,'Nowe wędki Short Spey firmy Thomas&amp;Thomas to dwie wędi o długości 11’ 2” zaprojektowane tak, aby pasowały do ​​różnych popularnych kompaktowych linek muchowych i głowic rzutowych. Są to lekkie, dwuręczne wędki o szybkim powrocie i akcji, która generuje dużą prędkość linki, zapewniając jednocześnie czułość umożliwiającą natychmiastowe wykrywanie delikatnych brań. Dostępne w klasach 6 i 7, wędki te są idealne do połowu dużych pstrągów migrujących oraz lekkich łososi atlantyckich i troci tęczowych. Ze względu na duże zapotrzebowanie, prosimy o uwzględnienie co najmniej czterech do sześciu tygodni na realizację zamówienia. CECHY: • 4-częściowy blank z wielomodułowego grafitu z nowym półmatowym niebieskim wykończeniem. • Zielone owijki z czerwoną obwódką. • Przelotki z tytanu i przelotki marki Universal Snake. • Uchwyt Full Wells Spey. • Matowo-czarny frezowany aluminiowy uchwyt kołowrotka z blokadą dolną. Uwaga: Wszystkie wędki T&amp;T są ręcznie wykonywane w Greenfield, MA. Prosimy o uwzględnienie 6-8 tygodni na wykonanie wędki przez naszych rzemieślników.','','wedka-muchowa-thomas-thomas-dna-short-spey','','','','Wędka muchowa Thomas & Thomas DNA Short Spey','','','',''),(86,1,1,'Wędkowanie w przybrzeżnych falach stwarza wyjątkowe możliwości i wyzwania dla wędkarza muchowego. Wiatr i fale utrudniają obsługę linki muchowej i osiągnięcie maksymalnej odległości rzutu. Dlatego T&amp;T zbudowało parę wędek, aby łowienie na muchę w przybrzeżnych falach było bardziej efektywne i przyjemne. Wędki Exocett Surf to para specjalistycznych wędzisk 11’2” przeznaczonych do rzucania nad głową przy użyciu dwóch rąk. Mocny blank StratoTherm o wielu modułach ma ostrą akcję, która doskonale sprawdza się przy rzucaniu nadklasowymi głowicami rzutowymi i zintegrowanymi głowicami muchowymi. Wydłużony górny uchwyt w kształcie full wells i zaokrąglony dolny uchwyt w stylu Spey zapewniają wygodne i mocne rzucanie nad głową podczas rzucania głowicami typu Outbound lub podobnymi. Opis: 4-częściowy blank wielomodułowy z matowym wykończeniem „T&amp;T Blue” Low-Friction. Solidne przelotki z tytanową ramą i standardową wkładką ceramiczną Zirconia. Wydłużony uchwyt w kształcie full wells i zaokrąglony dolny uchwyt w stylu Spey. Frezowany aluminiowy uchwyt kołowrotka z blokadą do wody morskiej. Uwaga: Wszystkie wędziska T&amp;T są ręcznie wykonywane w Greenfield, MA. Prosimy o uwzględnienie 6-8 tygodni na wykonanie wędziska przez naszych rzemieślników.','','wedka-muchowa-thomas-thomas-exocett-surf','','','','Wędka muchowa Thomas & Thomas Exocett Surf','','','',''),(87,1,1,'Środowisko morskie stanowi największe wyzwanie dla wędki muchowej. Dostarczanie muchy musi być szybkie i dokładne, ale wędka musi być również w stanie wywierać nieustępliwy nacisk na największe ryby łowione na świecie. Tuńczyki, makrele i rekiny są uczciwym celem dla tych potężnych specjalistycznych wędek. Cechy: Dwuczęściowy, wielomodułowy blank grafitowy w klasycznym niebieskim kolorze T&amp;T. Dłuższy uchwyt. Przelotki RECoil. Uchwyt kołowrotka z frezowanego aluminium anodowanego cyną. Zielone owijki z czerwoną krawędzią. W zestawie aluminiowa tuba wędki z obrabianym maszynowo kołnierzem z pręta aluminiowego i zatyczką. Niebieski lakier proszkowy z cyną z logo Thomas &amp; Thomas. Uwaga: Wszystkie wędki T&amp;T są ręcznie robione w Greenfield, MA.','','wedka-muchowa-thomas-thomas-bluewater','','','','Wędka muchowa Thomas & Thomas Bluewater','','','',''),(88,1,1,'CRUX','','crux','','','','CRUX','','','',''),(89,1,1,'CLAYMORE','','claymore','','','','CLAYMORE','','','',''),(90,1,1,'CLAYMORE TROUT SPEY','','claymore-trout-spey','','','','CLAYMORE TROUT SPEY','','','',''),(91,1,1,'PREDATOR','','predator','','','','PREDATOR','','','',''),(92,1,1,'Trace','','trace','','','','Trace','','','',''),(93,1,1,'STRIKE EURO NYMPH','','strike-euro-nymph','','','','STRIKE EURO NYMPH','','','',''),(94,1,1,'DUALLY','','dually','','','','DUALLY','','','',''),(95,1,1,'DUALLY TROUT SPEY','','dually-trout-spey','','','','DUALLY TROUT SPEY','','','',''),(96,1,1,'BUTTER STICK','','butter-stick','','','','BUTTER STICK','','','',''),(97,1,1,'VICE','','vice','','','','VICE','','','',''),(98,1,1,'CLASSIC TROUT','','classic-trout','','','','CLASSIC TROUT','','','',''),(99,1,1,'PATH','','path','','','','PATH','','','',''),(100,1,1,'Crosswater','','crosswater','','','','CROSSWATER','','','',''),(101,1,1,'YOUTH MINNOW','','youth-minnow','','','','YOUTH MINNOW','','','',''),(102,1,1,'Oryginalny kołowrotek Mirage został zaprojektowany tak aby był najlepszym kołowrotkiem na rynku. Jego przeznaczeniem jest walka z najmocniejszymi rybami. Projektując go myśleliśmy o takich gatunkach jak tarpon, GT i inne mocarne ,  szybko i daleko uciekające ryby. Mniejszy Mirage LT  oferuje najmocniejszy hamulec i bardzo mocną konstrukcję. Powstał przez rozważną rekonstrukcję oryginalnego Mirage. Dzięki naszym inżynierom oraz najnowocześniejszemu parkowi maszyn z Vermont USA, stworzyliśmy kołowrotek który jest o 30% lżejszy i 30% węższy niż oryginalny Mirage. Ten kołowrotek gwarantuje lepszy balans z nowoczesnymi bardzo lekkimi wędkami jak Orvis Helios3. Aby uzyskać mniejszą masę usunęliśmy materiał z miejsc gdzie nie był on niezbędny a pozostawiając go tam gdzie był potrzebny dla zachowania wytrzymałości i długowieczności. Dzięki temu  powstał olśniewający klejnot wśród kołowrotków, który wygląda, działa i brzmi jak żaden dotąd zrobiony przez nas kołowrotek. Uznaliśmy, że w wersji LT hamulec nie musi być tak ekstremalnie mocny jak w regularnym Mirage i zmniejszyliśmy ilość tarcz z 14 do 8, zmniejszając jednocześnie wagę. Ten zabieg zachował doskonałe właściwości hamulca , który bez problemu sprosta najbardziej wymagającym rybom które poławiamy na lżejsze wędki.  Stopka kołowrotka posiada otwory które również przyczyniły się do zmniejszenia wagi nie powodując utraty wytrzymałości.','','kolowrotek-muchowy-orvis-mirage-lt','','','','Kołowrotek muchowy Orvis Mirage LT','','','',''),(103,1,1,'Najbardziej technologicznie zaawansowany kołowrotek zaprojektowany i przemyślany  gruntownie od podstaw do walki z najsilniejszymi, wściekłymi rybami. Możesz z uśmiechem na twarzy łowić w bardzo korozyjnym środowisku jakim jest słona woda morska, nie martwiąc się o stan swojego kołowrotka. Mirage został wyposażony w szczelny, całkowicie bezobsługowy hamulec , zbudowany z naprzemiennych dysków z włókna węglowego i stali nierdzewnej.  Agresywne żłobkowane pokrętło hamulca pozwala na ustawienie od zera do pełnej siły hamowania za jednym obrotem. Opatentowany mechanizm zapadki pokrętła, zapewni gładkie nastawienie oporu  jednocześnie gwarantując stały jego poziom. Hamulec gwarantuje gładką pracę w całym zakresie regulacji od minimalnego do maksymalnego oporu, zapewniając bezpieczna walkę z każdą rybą. Mirage jest kołowrotkiem o dużej średnicy szpuli, dzięki czemu zwiększa się prędkość zwijania linki i zmniejsza jej podatność na skręcanie. Wyprodukowany z użyciem najnowocześniejszego parku maszyn w USA, z jednego bloku lekkiego i mocnego aluminium 6061 T6. Ergonomicznie zaprojektowana , aluminiowa korbka i przeciwwaga o niskim profilu. Bardzo mocna anodyzacja typu III  w standardzie wojskowym. Tytanowy trzon kołowrotka zwiększa jego wytrzymałość bez wzrostu wagi. Zaokrąglona stopka zapobiega zagniataniu się przypony gdy zawijamy żyłkę na stopce, zaczepiając muchę o przelotkę. W kołowrotkach w rozmiarze VI można zamiennie stosować szpule głębokie i płytkie.','','koloerotek-muchowy-orvis-mirage-usa','','','','Kołoerotek muchowy Orvis Mirage USA','','','',''),(104,1,1,'W pełni uszczelniony hamulec z ułożonymi na sobie podkładkami tarczowymi z węgla i stali nierdzewnej jest nadal jednym z najmocniejszych w branży, z zerową bezwładnością podczas rozruchu.','','kolowrotek-muchowy-orvis-hydros','','','','Kołowrotek muchowy Orvis Hydros','','','',''),(105,1,1,'Kolowrotki Battenkill Disc to konstrukcja która czerpie najlepsze cechy ze znanych i bardzo cenionych poprzednich wersji kołowrotków Orvisa. Jest to synteza użytkowości i nowych technologii. Hamulec zastosowany w tym kołowrotku bazuje na bardzo nowoczesnym rozwiązaniu znanym z kołowrotka Hydros SL. Zastosowanie  naprzemiennych tarcz ze stali nierdzewnej i grfitu, daje niezwykła płynność a zarazem łatwość nastwu siły hamowania. Kołowrotek jest konstrukcją typu Mid Arbor. Wykonany z aluminium lotniczego 6061-T6, metodą obróbki CNC. Powłoka galwaniczna w kolorze czarnego niklu jest bardzo trwała i estetyczna. Kołowrotek posiada możliwość zmiany działania hamulca z prawej na lewą. W zestawie klucz oraz pokrowiec.','','kolowrotek-muchowy-orvis-battenkill-disc','','','','Kołowrotek muchowy Orvis Battenkill Disc','','','',''),(106,1,1,'Świetny, ponadczasowy kołowrotek, o rewelacyjnym stosunku jakości do ceny. Teraz dostępny również w idealnie zbalansowanych rozmiarach IV i V, przeznaczonych do wędek speyowych. Prosty design i bezusterkowa konstrukcja „click and pawl” czynią z niego idealne narzędzie do wędkarstwa śródlądowego. Minimalistyczna budowa nowego kołowrotka Battenkill oferuje stylizowany na klasyczny, ale technicznie mocno udoskonalony, regulowany wewnętrznie, czteropozycyjny system hamulca „click and pawl”. Dzięki swojej konstrukcji kołowrotek idealnie współgra z dłonią. Do wyboru szpule o mniejszej i większej średnicy, byś sam mógł regulować długość potrzebnej Ci linki. Niezwykła lekkość tego kołowrotka sprawia, że idealnie nadaje się do krótszych wędek. Wykonany z ultralekkiego aluminium o bardzo dużej trwałości. Łatwe przystosowanie kołowrotka dla osób prawo- i leworęcznych. Laserowo grawerowane logo. Kolor: czarny nikiel.','','kolowrotek-muchowy-orvis-battenkill-bar-stock','','','','Kołowrotek muchowy Orvis Battenkill Bar Stock','','','',''),(107,1,1,'Wciąż najlepsza seria kołowrotków do połowu na muchę w branży, Clearwater Large-Arbor Reels ma nowy dodatek do rodziny — Clearwater II. Odlewana konstrukcja jest chroniona trwałym wykończeniem proszkowym, zbudowanym tak, aby wytrzymać intensywne użytkowanie. Ulepszony, uszczelniony hamulec tarczowy Carbon®-stainless sprawdza się w przypadku kołowrotków obrabianych maszynowo o wysokiej wydajności. Nowy kołowrotek muchowy Clearwater II łatwo przekształca się w lewo- lub praworęczny. Pokrętło hamulca z pozytywnym kliknięciem zapewnia spójne ustawienia. Zaktualizowana zaokrąglona stopka kołowrotka zapobiega załamywaniu się przyponu, gdy jest owinięty wokół niego. Rozmiar kołowrotka II 5,6 uncji 3,4\" Rozmiar kołowrotka III 6,1 uncji 3,7\" Rozmiar kołowrotka IV 6,5 uncji 4\" Idealna równowaga między wydajnością a wartością. Duży odlewany ciśnieniowo projekt z wytrzymałym wykończeniem proszkowym. Ulepszony uszczelniony system hamulca odporny na korozję. Zaktualizowany promień na stopce kołowrotka dla lepszego dopasowania.','','kolowrotek-muchowy-orvis-clearwater-new','','','','Kołowrotek muchowy Orvis Clearwater New','','','',''),(108,1,1,'Kołowrotek muchowy Orvis Clearwater® zestaw z dodatkowymi  szpulami. Wciąż najlepsza seria kołowrotków do połowu na muchę w branży, Clearwater Large-Arbor Reels ma nowy dodatek do rodziny — Clearwater II. Odlewana konstrukcja jest chroniona trwałym wykończeniem proszkowym, zbudowanym tak, aby wytrzymać intensywne użytkowanie. Ulepszony, uszczelniony hamulec tarczowy Carbon®-stainless sprawdza się w przypadku kołowrotków obrabianych maszynowo o wysokiej wydajności. Nowy kołowrotek muchowy Clearwater II łatwo przekształca się w lewo- lub praworęczny. Pokrętło hamulca z pozytywnym kliknięciem zapewnia spójne ustawienia. Zaktualizowana zaokrąglona stopka kołowrotka zapobiega załamywaniu się przyponu, gdy jest owinięty wokół niego. Rozmiar kołowrotka II 5,6 uncji 3,4\" Rozmiar kołowrotka III 6,1 uncji 3,7\" Rozmiar kołowrotka IV 6,5 uncji 4\" Idealna równowaga między wydajnością a wartością. Duży odlewany ciśnieniowo projekt z wytrzymałym wykończeniem proszkowym. Ulepszony uszczelniony system hamulca odporny na korozję. Zaktualizowany promień na stopce kołowrotka dla lepszego dopasowania.','','kolowrotek-muchowy-orvis-clearwater-new-zestaw-z-dodatkowymi-szpulami','','','','Kołowrotek muchowy Orvis Clearwater New zestaw z dodatkowymi  szpulami','','','',''),(109,1,1,'Nowe wcielenie kołowrotka Clearwater Large Arbor, nadal oferuje najlepsze na rynku rozwiązania w stosunku do ceny. Aluminiowy odlew oraz nowy, nowoczesny design  w matowym kolorze szarości,  świetny hamulec  z naprzemiennie umieszczonymi dyskami ze stali nierdzewnej oraz tworzywa o nazwie Rulon, sprawia, że Clearwater śmiało może konkurować z kołowrotkami z wyższej półki. Hamulec posiada pokrętło z wyraźnymi kliknięciami, zapobiegającymi samoczynnemu przestawieniu się siły hamowania.  Kołowrotek łatwo można ustawić tak aby zwijanie było możliwe prawą lub lewą ręką. Jeśli szukasz swojego pierwszego kołowrotka o dużej szpuli lub chcesz mieć porządny zastępczy kołowrotek w swojej torbie, to nowoczesny i zmodernizowany nowy Clearwater będzie świetnym wyborem.','','kolowrotek-muchowy-orvis-clearwater-la','','','','Kołowrotek muchowy Orvis Clearwater LA','','','',''),(110,1,1,'Nowy świetny kołowrotek kasetowy, zbudowany z odlewu aluminiowego, wykończony mocną powłoką proszkową. Nowa odsłona znanego modelu wciąż jest najlepszą propozycją na rynku w swojej klasie cenowej.  Zabudowany hamulec z dyskami z tworzywa Rulon ułożonymi naprzemiennie z dyskami ze stali nierdzewnej, daje moc do walki z silnymi rybami i może konkurować swymi parametrami z kołowrotkami z dużo wyższej półki. Kołowrotek można w łatwy sposób zamienić z prawo na leworęczną obsługę. Jeśli szukasz swojego pierwszego kołowrotka Large Arbor, lub chciałbyś mieć  zapasowy kołowrotek w swoim arsenale, nowy, ulepszony Clearwater LA spełni z pewnością Twoje oczekiwania. Rozmiar IV pomieści linki w klasach od 6 do 8. W zestawie dwie dodatkowe kasety oraz pokrowiec.','','clearwater-cassette','','','','Clearwater Cassette','','','',''),(111,1,1,'Grande','','kolowrotek-muchowy-redington-grande','','','','Kołowrotek muchowy Redington Grande','','','',''),(112,1,1,'TILT Euro Nymph','','kolowrotek-muchowy-redington-tilt-euro-nymph','','','','Kołowrotek muchowy Redington TILT Euro Nymph','','','',''),(113,1,1,'Behemoth','','kolowrotek-muchowy-redington-behemoth','','','','Kołowrotek muchowy Redington Behemoth','','','',''),(114,1,1,'RUN','','kolowrotek-muchowy-redington-run','','','','Kołowrotek muchowy Redington RUN','','','',''),(115,1,1,'ZERO','','kolowrotek-muchowy-redington-zero','','','','Kołowrotek muchowy Redington ZERO','','','',''),(116,1,1,'Echo Bravo','','echo-bravo','','','','Echo Bravo','','','',''),(117,1,1,'Echo Bravo LT','','echo-bravo-lt','','','','Echo Bravo LT','','','',''),(118,1,1,'Echo ION','','echo-ion','','','','Echo ION','','','',''),(119,1,1,'Echo Base','','echo-base','','','','Echo Base','','','',''),(120,1,1,'Całkowicie nowa seria linek Orvisa  z serii PRO, została zaprojektowana do specjalnych zadań. Wersja Trout o długiej 50\' (15m) głowicy, pozwala na lepszą kontrolę podczas długich rzutów. Zapewnia również doskonałą prezentację na krótszych dystansach. Kształt głowicy daje płynne przeniesienie energii gwarantując delikatne położenie muchy. Dzięki dłuższej części przedniej świetnie sprawdzi się przy rzutach rolowanych.','','linka-muchowa-orvis-pro-trout','','','','Linka muchowa Orvis PRO Trout','','','',''),(121,1,1,'','','linka-muchowa-orvis-pro-power-taper','','','','Linka muchowa Orvis PRO Power Taper','','','',''),(122,1,1,'Linki z serii PRO z teksturowaną powierzchnią, oferują zmniejszone tarcie w przelotkach a dzięki większej powierzchni zapewniają lepszą pływalność i wyższą pozycję na wodzie. Ułatwia to poderwanie linki z wody oraz poprawianie jej podczas łowienia. Mikro wgłębienia zapewniają jej również większą stabilność w powietrzu, podczas rzutu. Linki PRO zostały zaprojektowane i wyprodukowane w oparciu o najnowsze technologie i materiały, tak aby były one najlepszymi linkami na rynku. Zaawansowane profilowanie linki Trout, sprawia, że jest to bardzo uniwersalny sznur, do wykorzystania podczas łowienia różnymi technikami i w każdych warunkach. Pięćdziesięciostopowa głowica posiada delikatne zwężenie za którym jest pełna mocy grubsza część. Gwarantuje to doskonały transfer energii jednocześnie zapewniając delikatną prezentację. Dłuższe zwężenie tylne głowicy gwarantuje świetną kontrolę i łatwość rzutów.','','linka-muchowa-orvis-pro-trout-textured','','','','Linka muchowa Orvis PRO Trout Textured','','','',''),(123,1,1,'Linki muchowe Orvis PRO Power Taper Textured','','linka-muchowa-orvis-pro-power-taper-textured','','','','Linka muchowa Orvis PRO Power Taper Textured','','','',''),(124,1,1,'Linka muchowa Orvis Bank Shot Float','','linka-muchowa-orvis-hydros-bank-shot-float','','','','Linka muchowa Orvis Hydros Bank Shot Float','','','',''),(125,1,1,'Linka Hydros Trout','','linka-muchowa-orvis-hydros-trout','','','','Linka muchowa Orvis Hydros Trout','','','',''),(126,1,1,'Linka Hydros Trout w wersji DT','','linka-muchowa-orvis-hydros-trout-dt','','','','Linka muchowa Orvis Hydros Trout DT','','','',''),(127,1,1,'Linka Orvis Hydros Superfine','','linka-muchowa-orvis-hydros-superfine','','','','Linka muchowa Orvis Hydros Superfine','','','',''),(128,1,1,'Linka pływająca Orvis Clearwater Fly Line.','','linka-muchowa-orvis-clearwater-fly-line','','','','Linka muchowa Orvis Clearwater Fly Line','','','',''),(129,1,1,'PREMIUM PLUS TEXTURED','','linka-muchowa-royal-wulff-premium-plus-textured','','','','Linka muchowa Royal Wulff PREMIUM PLUS TEXTURED','','','',''),(130,1,1,'Triangle Taper Floating CLASSIC','','linka-muchowa-royal-wulff-triangle-taper-floating-classic','','','','Linka muchowa Royal Wulff Triangle Taper Floating CLASSIC','','','',''),(131,1,1,'Joan Wulff zaprojektowała tą łatwą do rzutów linkę typu WF/TT w dwóch kolorach, które zmieniają się pomiędzy głowicą, a runnin line. Linka zachowuje wszystkie właściwości linek TT. Doskonałą delikatną prezentację oraz łatwość w osiąganiu dużych dystansów.  Głowica o długości 32’- 38’ w zależności od klasy jest w kolorze jasnej kości słoniowej. Część przekazująca energię pomiędzy głowicą a running line  o długości 8’ oraz running są w kolorze pomarańczowym. Dzięki tym rozwiązaniom linka ta pozwala w widoczny i namacalny sposób poprawić rzuty każdego. Długość 90’(27m), w tym głowica 32’-38’ (10-12m) i linka rzutowa 52’-58’ Pływająca, kość słoniowa/pomarańczowy. 2, 3, 4, 5, 6, 7, 8','','linka-muchowa-royal-wulff-joan-signature','','','','Linka muchowa Royal Wulff Joan Signature','','','',''),(132,1,1,'Triangle Taper Floating 2 tone CLASSIC','','linka-muchowa-royal-wulff-triangle-taper-floating-2-tone-classic','','','','Linka muchowa Royal Wulff Triangle Taper Floating 2 tone CLASSIC','','','',''),(133,1,1,'Triangle Taper Floating  PLUS','','linka-muchowa-royal-wulff-triangle-taper-floating-plus','','','','Linka muchowa Royal Wulff Triangle Taper Floating  PLUS','','','',''),(134,1,1,'NYMPH  LINE','','linka-muchowa-royal-wulff-nymph-line','','','','Linka muchowa Royal Wulff NYMPH  LINE','','','',''),(135,1,1,'Triangle Taper Bass Line','','linka-muchowa-royal-wulff-triangle-taper-bass-line','','','','Linka muchowa Royal Wulff 