EX® Pro Cleaner','','','',''),(507,1,1,'<p>Wodery Orvis PRO Zipper</p>','','wodery-do-brodzenia-orvis-pro-zipper','','','','Wodery do brodzenia Orvis PRO Zipper','','','',''),(508,1,1,'Orvis PRO Wader został stworzony dla profesjonalnego wędkarza, który dołoży wszelkich starań, aby znaleźć ryby. Zbudowany z atletycznym krojem, PRO Wader wykorzystuje wyjątkowo trwałą, 4-warstwową powłokę z tkaniny Cordura® w górnej części i 5-warstwową powłokę z tkaniny Cordura w dolnej części nogawek, aby zapewnić najlepszą w swojej klasie odporność na ścieranie i przebicie. Niskoprofilowa konstrukcja szwu i klin z krokiem zwiększają ruch i wytrzymałość krocza. Nowoczesne anatomicznie poprawione ochraniacze neoprenowe mają mniejszą masę i są wygodniejsze w butach do brodzenia, a opływowa, wzmocniona PU siatkowa osłona żwiru ściśle przylega do buta i całkowicie eliminuje opór i gromadzenie wody. Wygodna zewnętrzną kieszeń z wodoodpornym zamkiem błyskawicznym YKK AquaGuard®, który utrzymuje niezbędne rzeczy suche i zapobiega utracie. Gumowane zakładki na szelkach i łańcuch na przedniej kieszeni do narzędzi, oferują wiele lokalizacji niezbędnych rzeczy i eliminują ryzyko przebicia woderów lub utraty narzędzi. Naszywana naszywka na przedniej kieszeni zapewnia szybkie zmiany i suszenie much. Duża czterokierunkowa wewnętrzna kieszeń z elastycznej siatki powiększa się, aby zmieścić większe przedmioty, ale nie przeszkadza, gdy jest pusta. Kieszenie polarowe z podszewką z polaru z wodoodpornymi zamkami YKK AquaGuard. Wyjmowane ochraniacze kolan OrthoLite® wykorzystują tę samą technologię, która znajduje się w naszej wkładce PRO Boot, zapewniając optymalny komfort i odbicie. Wyjmowana kieszeń na akcesoria pozwala na szybki dostęp do sprzętu i oferuje cechy małej paczki. Regulowane elastyczne szelki z przeciwstawnymi klamrami do konwersji talii. Wewnętrzna naszywka na rzep mieści naszą wodoodporną kieszeń Orvis (8G3H sprzedawana osobno). Wadery ważą około 48 uncji w (średnim rozmiarze).100% nylonowa powłoka z membraną poliuretanową. Podszewka trykot 100% nylon. Importowany. 14 rozmiarów S-XXL, w tym krótkie i długie rozmiary.','','wodery-do-brodzenia-orvis-pro','','','','Wodery do brodzenia Orvis PRO','','','',''),(509,1,1,'Tak firma Orvis opisuje model woderów ORVIS PRO LT: Nasz najbardziej wytrzymały, a jednocześnie lekki system spodniobutów. Opatentowana czterowarstwowa powłoka z tkaniny CORDURA®. Łatwe, niekrępujące ruchy dzięki klinowi w kroku i niskoprofilowej konstrukcji szwów. Wygodna, elastyczna i pojemna zewnętrzna kieszeń do ogrzewania dłoni i przechowywania akcesoriów. Szybki dostęp do narzędzi dzięki gumowym uchwytom kieszeni i łańcuszkowi daisy. Profilowany komfort stóp dzięki nowoczesnym, anatomicznie zaprojektowanym skarpetą z neoprenu. Eliminujące opór, opływowe, wzmocnione poliuretanem ochraniacze przeciw żwirowi z ukrytym zatrzaskiem, aby utrzymać je przymocowane do buta podczas brodzenia. Wyściełane, wygodne, wyjmowane, przeprojektowane nakolanniki OrthoLite o grubości 3 mm. Wodery idealnie pasują do butów do brodzenia ORVIS PRO LT.','','wodery-do-brodzenia-orvis-pro-light','','','','Wodery do brodzenia Orvis Pro Light','','','',''),(510,1,1,'Opatentowana czterowarstwowa powłoka z tkaniny CORDURA® zapewniająca maksymalną trwałość. Wodoodporny zamek błyskawiczny TIZIP® MasterSeal ułatwiający zakładanie i zdejmowanie. Wyjmowane nakolanniki OrthoLite® o grubości 3 mm. Nowoczesne, anatomicznie poprawne, neoprenowe buty. Klin w kroku i niskoprofilowa konstrukcja szwów. Łańcuchowe mocowanie akcesoriów. Zewnętrzna kieszeń do przechowywania. Ukryty zatrzask buta, aby utrzymać osłonę przeciwżwirową na dole. Uproszczona osłona przeciwżwirowa z siatki wzmocnionej poliuretanem eliminuje opór i zbieranie się wody.','','wodery-do-brodzenia-orvis-pro-light-wading-pants-krotkie-do-pasa','','','','Wodery do brodzenia Orvis PRO Light Wading Pants krótkie do pasa','','','',''),(511,1,1,'Wodery męskie Orvis Ultralight, to kolejny element całego systemu Ultralihght. Są one niezwykle wsyechstronnym projektem,lekkich woderów które nic nie tracą na wytrzymałości i właściwościach w porównaniu do klasycznych \"grubych\" woderów.. Niesamowicie wygodne, nowocześnie dopasowane, zapewnia doskonałą wydajność bez wsrostu wagi i masy. Powłoka zewnętrzna: 100% nylon. Membrana: dwuskładnikowy poliuretan. Wkładka: 100% trykot nylonowy. Importowany.  - Nowoczesny krój - 4-warstwowa, wodoodporna, oddychająca tkanina nylonowa - Zapięcia magnetyczne FIDLOCK SNAP zapewniają szybką i lekką konwersję w pasie - Kieszeń zewnętrzna z wodoodpornym suwakiem YKK AquaGuard® - Zintegrowana stacja dokująca - Ergonomiczne skarpety z neoprenu o wysokiej gęstości - Zintegrowane ochraniacze, zapobiegają przedostawaniu się żwiru i piasku do butów i jednocześnie zmniejszają opór wody. - Nowa nisko profilowana konstrukcja szwów ze strategicznym wzmocnieniem w obszarach o dużym obciążeniu - Wewnętrzna kieszeń na zamek błyskawiczny z czterostronnie rozciągliwą siatką - Niskoprofilowe szlufki z paskiem 1,5 \"w komplecie - Rzep na wewnętrznej kieszeni na wodoszczelną kieszeń Orvis (8G3H sprzedawana oddzielnie) Przybliżona waga rozmiar L 35 uncji / 995 g','','wodery-do-brodzenia-orvis-ultralight-convertible','','','','Wodery do brodzenia Orvis Ultralight Convertible','','','',''),(512,1,1,'Orvis Clearwater Wader','','wodery-do-brodzenia-orvis-clearwater-wader','','','','Wodery do brodzenia Orvis Clearwater Wader','','','',''),(513,1,1,'Trzy warstwowa górna warstwa GORE-TEX® Pro Shell.','','g4z-stockingfoot','','','','G4Z Stockingfoot','','','',''),(514,1,1,'','','g4-pro-stockingfoot','','','','G4 Pro Stockingfoot','','','',''),(515,1,1,'Men\'s Swiftcurrent Expedition Waders','','mens-swiftcurrent-expedition-waders','','','','Mens Swiftcurrent Expedition Waders','','','',''),(516,1,1,'Men\'s Swiftcurrent Expedition Zip-Front Waders','','mens-swiftcurrent-expedition-zip-front-waders','','','','Mens Swiftcurrent Expedition Zip-Front Waders','','','',''),(517,1,1,'Men\'s Swiftcurrent Wading Pants','','mens-swiftcurrent-wading-pants','','','','Mens Swiftcurrent Wading Pants','','','',''),(518,1,1,'Orvis ma zaszczyt zaprezentować pierwszy w historii produkt powstały dzięki wysiłkowi dwóch firm z olbrzymią tradycją w swojej dziedzinie. Współpraca Orvisa z firmą Michelin zaowocowała powstaniem podeszwy o najlepszej trakcji podczas brodzenia w wodzie, oraz odlewanej zewnętrznej części buta, która eliminuje szwy w strefach zwiększonego tarcia, zapewniając jednocześnie niedoścignioną trwałość i wytrzymałość butów.','','buty-do-brodzenia-orvis-pro-boa','','','','Buty do brodzenia Orvis PRO BOA','','','',''),(519,1,1,'<p>Orvis ma zaszczyt zaprezentować pierwszy w historii produkt powstały dzięki wysiłkowi dwóch firm z olbrzymią tradycją w swojej dziedzinie. Współpraca Orvisa z firmą Michelin zaowocowała powstaniem podeszwy o najlepszej trakcji podczas brodzenia w wodzie, oraz odlewanej zewnętrznej części buta, która eliminuje szwy w strefach zwiększonego tarcia, zapewniając jednocześnie niedoścignioną trwałość i wytrzymałość butów.</p>','','buty-do-brodzenia-orvis-pro-wading','','','','Buty do brodzenia Orvis PRO Wading','','','',''),(520,1,1,'Buty Orvis Ultralight Wading','','buty-do-brodzenia-orvis-ultralight-wading','','','','Buty do brodzenia Orvis Ultralight Wading','','','',''),(521,1,1,'Buty Orvis PRO Approach','','buty-do-brodzenia-orvis-pro-approach','','','','Buty do brodzenia Orvis PRO Approach','','','',''),(522,1,1,'Buty z podeszwą filcową Orvis Encounter Wading - Felt','','buty-do-brodzenia-orvis-encounter-wading-na-filcu','','','','Buty do brodzenia Orvis Encounter Wading - na filcu','','','',''),(523,1,1,'Buty do brodzenia Orvis Clearwater Wading Felt','','buty-do-brodzenia-orvis-clearwater-wading-felt','','','','Buty do brodzenia Orvis Clearwater Wading Felt','','','',''),(524,1,1,'Buty do brodzenia z podeszwą gumową Orvis Clearwater Wading Rubber Sole','','buty-do-brodzenia-orvis-clearwater-wading-rubber-sole','',